 function home() {

let navigate=useNavigate();
const [meetingcode,setMeetingCode]=useState("");

let handleJoinVideoCall=async()=>{
  navigate(`/${meetingcode}`);
}

  return (
    <div>
      Home components
    </div>
  )
}

export default withAuth(home);
